import React,{Component} from "react";
import{Div0,Selectleft,Selectcenter,Selectright}from'./style';
class SelectList extends Component{
    render(){
        return (
            <Div0>
                <Selectleft>
                    <option>全體</option>
                    <option>個人</option>
                </Selectleft>
                <Selectcenter>
                    <option>二頭肌</option>
                    <option>三角肌</option>
                    <option>下肢</option>
                </Selectcenter>
                <Selectright>
                    <option>二頭肌</option>
                    <option>三角肌</option>
                    <option>下肢</option>
                </Selectright>
            </Div0>
        )}}
export default SelectList;
